import * as React from 'react';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Navbar from '../Components/Navbar';
import Login from '../Components/Login';
import img from '../assets/note.jpg' // Replace with the actual path to your image

export default function Home() {
    const paperstyle = { width: 1200 }; // Remove height and marginTop

    return (
        <>
            <Navbar />
            <Grid container justifyContent="center">
                <Paper elevation={3} style={{ ...paperstyle, minHeight: '70vh',marginTop:"100px" }}>
                    <Grid container  justifyContent="center" style={{height:"100%"}}>
                        <Grid item xs={12} sm={6}>
                            <img src={img} alt="Description of your image" style={{ width: '100%', height: '100%', objectFit: 'cover' }} />
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <Login />
                        </Grid>
                    </Grid>
                </Paper>
            </Grid>
        </>
    );
}
